class Solution(object):
    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # 1. Mark all negative numbers, 0s, and numbers larger than n as invalid
        # 2. Iterate through the array, marking numbers as seen
        # 3. Iterate through the array again, if a number is not seen, return it

        n = len(nums)

        for i in range(n):
            if nums[i] <= 0:
                nums[i] = n + 1

        for i in range(n):
            num = abs(nums[i])
            if num <= n:
