    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(i, curr, prev, op, res):
            if i == len(num):
                if curr == target and op == '+':
                    res.append(curr)
                return
            for j in range(i, len(num)):
                if j > i and num[i] == '0':
                    break
                curr = curr * 10 + int(num[j])
                if op == '+':
                    backtrack(j + 1, curr, curr, '+', res)
                elif op == '-':
                    backtrack(j + 1, curr - prev, -curr, '-', res)
                elif op == '*':
                    backtrack(j + 1, curr * prev, curr, '*', res)

        res = []
        backtrack(0, 0, 0, '+', res)
        return res

