class Solution(object):
    def toHex(self, num):
        """
        :type num: int
        :rtype: str
        """

        if num == 0:
            return '0'

        if num < 0:
            num = 2**32 + num

        hex_dict = {10:'a', 11:'b', 12:'c', 13:'d', 14:'e', 15:'f'}
        hex_list = []

        while num > 0:
            hex_list.append(num % 16)
            num = num // 16

        hex_list.reverse()

        for i in range(len(hex_list)):
            if hex_list[i] >= 10:
                hex_list[i] = hex_dict[hex_list[i]]

        return ''.join(map(str, hex_list))

