class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        def is_concatenated(word, word_dict):
            if word in word_dict:
                return True
            for i in range(1, len(word)):
                left, right = word[:i], word[i:]
                if left in word_dict and right in word_dict:
                    return True
            return False

        word_dict = set(words)
        return [word for word in words if is_concatenated(word, word_dict)]

